import { Bar } from "react-chartjs-2";

const data = {
    labels: ['Red', 'Blue', 'Yellow', 'Green', 'Purple', 'Orange'],
    datasets: [{
        label: '# of Votes',
        data: [12, 19, 3, 5, 2, 3],
        borderWidth: 1
    }],
}

const options = {
    scales: {
        y: {
            beginAtZero: true,
        },
    },
    plugins: {
        legend: {
            display: true,
            position: 'top',
        },
    },
};

const BarChart = () => {
    return (
        <>
            <Bar data={data} options={options} />
        </>
    )
}

export default BarChart;
